    true,nt"url": null,nt"notes": "<p>The CMS Office of Enterprise Data and
    Analytics (OEDA) produced an annual Medicare and Medicaid Statistical Supplement
    report providing detailed statistical information on Medicare, Medicaid, and other
    Centers for Medicare and Medicaid Services (CMS) programs. The Supplements include
    115 tables and 67 charts describing health expenditures for the entire U.S. population,
    characteristics of the Medicare and Medicaid covered populations, use of services,
    and expenditures under these programs. These CMS reports were published annually
    in electronic form from 2001 through 2013. The Statistical Supplements are organized
    into 14 chapters which can each be downloaded and viewed separately. The CMS Program
    Statistics is replacing the Statistical Supplement.</p>n",nt"license_title":
